import axios from 'axios'
import config from '../config'

export default async function (url) {
    try {
        console.log(config.localApiUrl)
        const { data } = await axios({
            baseUrl: config.localApiUrl,
            url: url,
            methode: 'get'
        })
        return data
    } catch (error) {
        return error.response || { status: 404 }
    }
}
